const Profile = ({dataUserContext}) => {
/*     console.log(dataUserContext) */
  
const renderLoginUser = dataUserContext.map((user)=>{
    return(
        <div>{user.user.alias}</div>
    )
})

return (
    <div>
      <h1>User: {}</h1>
      <h4>Email:</h4>
      <h5>Alias</h5>
    </div>
  )
}

export default Profile
